const ClassButton = ({book}) => {
    return (
        <div>
            <Link to={`/books/${book.class}`}><Button className='btn btn-block classbtn btn-lg' style={{color: '#ef4444'}}>Class {book.class}</Button></Link>
            
        </div>
    )
}

export default ClassButton
